import React from 'react';
import menuImage from './images/logo1.png'; // Example image for Menu
import happyHourImage from './images/img2.png'; // Example image for Happy Hour
import locationImage from './images/img1.png'; // Example image for Location
import dessertImage from './images/img3.png'; // Example image for Desserts
import drinksImage from './images/img1.png'; // Example image for Drinks
import snacksImage from './images/img2.png'; // Example image for Snacks
import seafoodImage from './images/img1.png'; // Example image for Seafood
import bakeryImage from './images/img2.png'; // Example image for Bakery
import Footer from './Footer';

const HomePage = () => {
  const styles = {
    homePage: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
    },
    heroSection: {
      height: '30vh',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      position: 'relative',
      width: '100%',
      marginTop: 0,
      paddingBottom: 0,
    },
    heroOverlay: {
      color: '#ffffff',
      fontSize: '3rem',
      textAlign: 'center',
      fontFamily: "'Dancing Script', cursive",
      letterSpacing: '1px',
      lineHeight: 1.2,
      textShadow: '2px 2px 8px rgba(0, 0, 0, 0.8)',
      margin: 0,
      padding: 0,
    },
    circlesSection: {
      display: 'flex',
      justifyContent: 'center',
      gap: '20px',
      marginTop: '0.2cm',
      padding: '0 20px',
    },
    circleItem: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      cursor: 'pointer',
    },
    circleImage: {
      width: '75px',
      height: '75px',
      borderRadius: '50%',
      objectFit: 'cover',
      padding: '3px',
      background: 'linear-gradient(45deg, #8D6E63, #D4AF37, #d9b8a6)',
      border: '4px solid transparent',
      backgroundClip: 'padding-box',
    },
    circleLabel: {
      marginTop: '8px',
      fontSize: '0.9rem',
      color: '#333',
      textAlign: 'center',
    },
    gridSection: {
      display: 'grid',
      gridTemplateColumns: 'repeat(3, 1fr)',
      gap: '0.5cm',
      padding: '20px',
      maxWidth: '800px',
      margin: '0 auto',
      flexGrow: 1,
      backgroundColor: 'transparent',
    },
    gridItem: {
      textAlign: 'center',
      padding: '10px',
      position: 'relative',
      width: '150px',
      height: '150px',
      transition: 'transform 0.3s ease-in-out, background-color 0.3s ease-in-out',
      borderRadius: '10px',
    },
    gridItemHover: {
      transform: 'scale(1.05)',
      backgroundColor: 'rgba(211, 211, 211, 0.3)',
    },
    gridImage: {
      width: '100%',
      height: '100%',
      borderRadius: '10px',
      objectFit: 'cover',
    },
    gridHeading: {
      marginTop: '10px',
      fontSize: '1rem',
      fontWeight: 'bold',
      color: '#333',
      transition: 'color 0.3s ease-in-out',
    },
    gridHeadingHover: {
      color: '#D4AF37',
    },
  };

  return (
    <div style={styles.homePage}>
      <div style={styles.heroSection}>
        <div style={styles.heroOverlay}>
          <h1>CulinarEAT</h1>
        </div>
      </div>

      <div style={styles.circlesSection}>
        {[
          { src: menuImage, label: 'About Us' },
          { src: happyHourImage, label: 'Cooking Tips' },
          { src: locationImage, label: 'Baking Tips' },
          { src: dessertImage, label: 'Conversions' },
        ].map((item, index) => (
          <div style={styles.circleItem} key={index}>
            <img src={item.src} alt={item.label} style={styles.circleImage} />
            <span style={styles.circleLabel}>{item.label}</span>
          </div>
        ))}
      </div>

      <div style={styles.gridSection}>
        {[
          { src: menuImage, label: 'Menu' },
          { src: happyHourImage, label: 'Happy Hour' },
          { src: locationImage, label: 'Location' },
          { src: dessertImage, label: 'Desserts' },
          { src: drinksImage, label: 'Drinks' },
          { src: snacksImage, label: 'Snacks' },
          { src: seafoodImage, label: 'Seafood' },
          { src: bakeryImage, label: 'Bakery' },
        ].map((item, index) => (
          <div
            style={styles.gridItem}
            key={index}
            onMouseOver={(e) => (e.currentTarget.style = { ...styles.gridItem, ...styles.gridItemHover })}
            onMouseOut={(e) => (e.currentTarget.style = styles.gridItem)}
          >
            <img src={item.src} alt={item.label} style={styles.gridImage} />
            <h2 style={styles.gridHeading}>{item.label}</h2>
          </div>
        ))}
      </div>

      <Footer />
    </div>
  );
};

export default HomePage;
